import { Component, Inject } from '@angular/core';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-user-delete-dialog',
  templateUrl: './user-delete-dialog.component.html',
})
export class UserDeleteDialogComponent {

  constructor(
    public dialogRef: MatDialogRef<UserDeleteDialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: { userId: string }
  ) { }

  onNoClick(): void {
    this.dialogRef.close();
  }
}
<h2 mat-dialog-title>Delete User</h2>
<div mat-dialog-content>
  <p>Enter User ID:</p>
  <mat-form-field>
    <input matInput [(ngModel)]="data.userId" placeholder="User ID">
  </mat-form-field>
</div>
<div mat-dialog-actions>
  <button mat-button (click)="onNoClick()">Cancel</button>
  <button mat-button [mat-dialog-close]="data" cdkFocusInitial>Delete</button>
</div>
